import logo from "./logo.svg";
import react, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = [
      { name: "Frankenstein" },
      { name: "Dracula" },
      { name: "Zombie" },
    ];
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
         {
           this.state.map=(monster=>{<h1>{monster}</h1>})
         }
        </header>
      </div>
    );
  }
}

export default App;
